(3, 1300983045, 'y', 0, 'Машка', 'mk@ya.ru', 'Бум-бурум! Вопилки!'),
(4, 1300986948, 'y', 0, 'Гриша', 'grisha@mail.com', 'xxx: звонок в call-центр: "помогите!!! банкомат бабушку душит!".\r\nxxx: оказалось, бабулька проковыряла в карте дырочку и повесила на шею, чтобы не\r\nпотерять, карту вставила в банкомат, что-то, видно, неправильно набрала. \r\nxxx: а дальше банкомат захватил карту в реджект-касету, ну и бабку затянуло....\r\nxxx: банкоматы - убийцы!'),
(5, 1300987111, 'y', 0, 'Никифор Андреич', 'na@rambler.ru', 'Форум врачей:\r\nСегодня просто чудный звонок: "... А то вот я лечилась у одного врача - так он совсем-совсем не помог. Назначил какие-то таблетки, а они совсем не помогли. Я, правда, их пить не стала, побоялась, но врач вообще не помог".\r\n(Это дословная запись)'),
(6, 1300987199, 'y', 0, 'Скубиду', 'scoobee@doo.org', 'xxx: Ты - страус. Сунул голову в песок и спрятался от проблем!\r\nyyy: Я не спрятался, я ем крота'),
(7, 1300987366, 'y', 0, 'Машка', 'mashka@ya.ru', 'xxx: Самое абсурдное, что я когда-либо видела – это когда человек, идя по улице во время дикого гололёда, подскользнулся на банановой кожуре.'),
(8, 1300987441, 'y', 0, 'Нат', 'nat@ya.ru', 'Мама: Доченька, ты почему сегодня пришла домой без перегара? Ты что, поругалась с девочками?!'),
(9, 1300987498, 'y', 0, 'Boriska Iriska', 'borya@ef.ru', 'xxx: Моя мама меня пугает. \r\nxxx: Купила какой-то новый чай, я сижу за компом, пью. \r\nxxx: Она подходит, говорит: "Понюхай, чем чай пахнет?" Я (уже привык, что она всегда крепко заваривает): "Крепким чаем?" Мама (весело): "Нет, цианистым калием!" \r\nxxx: Я аж захлебнулся! \r\nxxx: Оказалось, чай с миндалем был...'),
(10, 1300987548, 'y', 0, 'Нюша', 'n@ya.ru', 'ххх: он уже назвал меня один раз истеричкой, когда я расплакалась во время фильма и вытела сопли его котом'),
(11, 1300987696, 'y', 0, 'S300Rocket', 's300@r0.ru', 'она: - вот сейчас задержишься, опоздаешь на работу и объяснишь: "не мог вылезти из-под своей девушки"\r\nон: - ага, а потом задержусь с работы и объясню: "не мог вылезти из-под своего шефа"...'),
(12, 1300990908, 'y', 0, 'SL', 'sl@sl.com', 'Поскольку государственные организации имеют ряд особенностей при покупке программного обеспечения, ведущие мировые производители предоставляют им специальные условия лицензирования.'),
